                <p>문의 사항 및 건의 사항은 dlsgh120@gmail.com 으로 보내주시면 답변 드리겠습니다.</p>
                <p></p>
            </FooterContainer>
        </FooterWrap>
    );
}

const FooterWrap = styled.div`
    background-color:#b4b2b2;
    width:100%;
`;

const FooterContainer = styled.div`
    width:1180px;
    margin: 0 auto;
    max-width:100%;
`;
export default Footer;
